import React, { useState } from "react";
import "./styles/recentTrades.css";

const RecentTrades = ({ recentTrades, formatDate, onRefresh }) => {
  const [selectedTrade, setSelectedTrade] = useState(null);
  const [editedTrade, setEditedTrade] = useState(null);

  const handleRefresh = () => {
    onRefresh();
  };

  const roundStrikePrice = (strikePrice) => {
    return Math.round(parseFloat(strikePrice) * 10) / 10;
  };

  const handleRowClick = (trade) => {
    setSelectedTrade(trade);
    setEditedTrade({ ...trade }); // Initialize edited trade with the selected trade
  };

  const handleCloseModal = () => {
    setSelectedTrade(null);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEditedTrade((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    try {
      // Send a request to update the trade data on the backend
      const response = await fetch(
        `http://localhost:8000/trades/${editedTrade.trade_id}`,
        {
          method: "PUT",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(editedTrade),
        }
      );
      if (!response.ok) {
        throw new Error("Failed to update trade data");
      }
      // Parse the response data
      const updatedTradeData = await response.json();
      // Close the modal after successfully updating the trade
      handleCloseModal();
      // Provide feedback to the user
      alert("Trade data updated successfully");
      // Refresh the recent trades
      onRefresh();
    } catch (error) {
      console.error("Error updating trade data:", error);
      // Provide feedback to the user
      alert("Failed to update trade data. Please try again later.");
    }
  };

  // const handleFormSubmit = (e) => {
  //   e.preventDefault();
  //   // Send a request to update the trade data on the backend
  //   fetch(`http://localhost:8000/trades/${editedTrade.trade_id}`, {
  //     method: "PUT",
  //     headers: {
  //       "Content-Type": "application/json",
  //     },
  //     body: JSON.stringify(editedTrade),
  //   })
  //     .then((response) => {
  //       if (!response.ok) {
  //         throw new Error("Failed to update trade data");
  //       }
  //       // Close the modal after successfully updating the trade
  //       handleCloseModal();
  //       // Provide feedback to the user
  //       alert("Trade data updated successfully");
  //       // Optional: You can update the frontend state with the edited trade data here if needed
  //     })
  //     .catch((error) => {
  //       console.error("Error updating trade data:", error);
  //       // Provide feedback to the user
  //       alert("Failed to update trade data. Please try again later.");
  //     });
  // };

  return (
    <div className="recent-trades">
      <div className="card">
        <p className="recent">Recent Trades</p>
        <i
          className="fa-solid fa-arrows-rotate"
          id="refresh-btn"
          onClick={handleRefresh}
        ></i>
      </div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Date</th>
            <th>Symbol</th>
            <th>Stock Price</th>
            <th>Type</th>
            <th>Strike Price</th>
            <th>Entry Price</th>
            <th>Exit Price</th>
            <th>Contracts</th>
            <th>Expiration Date</th>
          </tr>
        </thead>

        <tbody>
          {recentTrades.map((trade) => (
            <tr key={trade.trade_id} onClick={() => handleRowClick(trade)}>
              <td>{trade.trade_id}</td>
              <td>{formatDate(trade.trade_date)}</td>
              <td>{trade.option_symbol}</td>
              <td>${trade.underlying_stock_price}</td>
              <td>{trade.option_type}</td>
              <td>${roundStrikePrice(trade.strike_price)}</td>
              <td>${trade.entry_price}</td>
              <td>{trade.exit_price ? `$${trade.exit_price}` : ""}</td>
              <td>{trade.contracts}</td>
              <td>{formatDate(trade.expiration_date)}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {selectedTrade && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={handleCloseModal}>
              &times;
            </span>
            <p>Edit Trade: {selectedTrade.trade_id}</p>
            <form onSubmit={handleFormSubmit}>
              <div className="form-group">
                <label htmlFor="option_symbol">Option Symbol:</label>
                <input
                  type="text"
                  name="option_symbol"
                  value={editedTrade.option_symbol}
                  onChange={handleInputChange}
                />{" "}
                <label htmlFor="option_type">Option Type:</label>
                <input
                  type="text"
                  name="option_type"
                  value={editedTrade.option_type}
                  onChange={handleInputChange}
                />{" "}
                <label htmlFor="strike_price">Strike Price:</label>
                <input
                  type="text"
                  name="strike_price"
                  value={editedTrade.strike_price}
                  onChange={handleInputChange}
                />{" "}
                <label htmlFor="strike_price">Entry Price:</label>
                <input
                  type="text"
                  name="entry_price"
                  value={editedTrade.entry_price}
                  onChange={handleInputChange}
                />{" "}
                <label htmlFor="exit_price">Exit Price:</label>
                <input
                  type="text"
                  name="exit_price"
                  value={editedTrade.exit_price}
                  onChange={handleInputChange}
                />
                <label htmlFor="contacts">Contracts:</label>
                <input
                  type="text"
                  name="contracts"
                  value={editedTrade.contracts}
                  onChange={handleInputChange}
                />
                <label htmlFor="underlying_stock_price">Stock Price:</label>
                <input
                  type="text"
                  name="underlying_stock_price"
                  value={editedTrade.underlying_stock_price}
                  onChange={handleInputChange}
                />
                <label htmlFor="rationale">Rationale:</label>
                <input
                  type="text"
                  name="rationale"
                  value={editedTrade.rationale}
                  onChange={handleInputChange}
                />{" "}
                <label htmlFor="feedback">Feedback:</label>
                <input
                  type="text"
                  name="feedback"
                  value={editedTrade.feedback}
                  onChange={handleInputChange}
                />{" "}
                <label htmlFor="outcome">Outcome:</label>
                <input
                  type="text"
                  name="outcome"
                  value={editedTrade.outcome}
                  onChange={handleInputChange}
                />
              </div>
              <button type="submit" className="btn">
                Save Changes
              </button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default RecentTrades;

